// HomePage.js
import React from 'react';
import yourSvg from './components/HomePage.svg';

const HomePage = () => {
  return (
    <div style={{ width: '100vw', height: '100vh', overflow: 'hidden', position: 'relative' }}>
      {/* Apply opacity to the SVG */}
      <img src={yourSvg} alt="Your SVG" style={{ width: '100%', height: '100%', objectFit: 'cover', opacity: 0.5 }} />

      <div>
        <video autoPlay loop muted playsInline style={{ position: 'absolute', top: 10, left: 0, width: '100%', height: '100%' }}>
          <source src="./components/background.mp4" type="video/mp4"></source>
        </video>
      </div>
    </div>
  );
};

export default HomePage;
